import backArrow from '../assets/back.png';
import alert from '../assets/alert.png';
import classes from './createEvent.module.css';






function CreateEvent() {

    return (
        <div className={classes.createEvent}>
            <div>
                <div className={classes.createEventbar}>
                    <img src={backArrow} alt="Back" className={classes.backArrow} />
                    <p>Create Your Event</p>
                    <img src={alert} alt="Alert" className={classes.alertIcon} />
                </div>
                <div className={classes.uploadImage}>
                    <label for="cover-upload" style="cursor: pointer;">
  Upload cover
</label>
<input type="file" id="cover-upload" accept="image/*" style="display: none;" />

                    <input type="file" accept="image/*" placeholder='upload cover' />
                </div>

            </div>


        </div>

       );
}

